import React, { Component } from 'react';
import { Parallax } from 'react-parallax';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


import './Home.css';
const image1 = "./imgs/frontPatio.jpg"
const image2 = "./imgs/diningRoom.jpg";
const image3 = "./imgs/lounge.jpg";
const image4 = "./imgs/terrace.jpg";
const image5 = "./imgs/theGrotto.jpg";



class HomePage extends Component {
    render() {
        return (
           <div className="homePage">
                {/* FRONT PAGE */}
                <Container className="container">
                    <Row className="mainContent">
                        <Col>
                            <h1>Hello?</h1>
                            <h1>Hello?</h1>
                            <h1>Hello?</h1>
                        </Col>
                    </Row>
                </Container>

                {/* AREAS/PARALLAX SECTION */}

                <Container fluid>

                    {/* ROW 1 */}
                    <Row  className="inside">
                        <Col xs={12} md={4}>
                            <h1>Text</h1>
                        </Col>
                        <Col xs={12} md={8}>
                            <Parallax 
                                bgImage={image1} 
                                bgImageStyle={{
                                    height:"675px",
                                    width:"100%",
                                    position: "absolute"
                                    }} 
                                strength={500} 
                                >
                                <div className="parallaxSize">
                                    <div className="inside">

                                    </div>
                                </div>
                            </Parallax>
                        </Col>
                    </Row>
                </Container>
           </div>
        )
    }   
}


export default HomePage;
